import React from 'react';
import "./index.css"


const img4 = "https://picsum.photos/200/303"
const img5 = "https://picsum.photos/200/304"
const img6 = "https://picsum.photos/200/305"



function Images_2(){
    return(
        <div className = 'img_dev'>
        <img  src ={img4} alt = "randomImages" />
        <img  src ={img5} alt = "randomImages" />
        <img  src ={img6} alt = "randomImages" />
        </div>

    )
}


export default Images_2;
